import React, { Component } from 'react';
import { Row, Col } from 'antd';
import './index.css';

export default class List extends Component {
    render() {
        const { category,list } = this.state;
        return (
            <div>
                <Row gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }}>
                    <Col className="gutter-row" span={6}>
                        <div className='list-box'>
                            <div>
                                <img alt='' src='/123.png'></img>
                                <h3>Findora Wallet</h3>
                                <span>{category}</span>
                            </div>
                            <div>
                                <span>The Findora wallet enables you to send and receive FRA tokens and even create your own custom assets.</span>
                            </div>
                            <ul>
                                <li><img alt='' src='/123.png'></img></li>
                            </ul>
                        </div>
                    </Col>
                </Row>
            </div>
        )
    }
}
